import React from 'react';

const Home = () => {
    const [msg, setMsg] = useState('hi guys');
    const [idnum, setIdNum] = useState(350);
    const [tickets, setTickets] = useState([
        {ticketID: 5, orders: 'water, coke, chips', total: 53.21},
        {ticketID: 2, orders: 'cookie, juice', total: 13.10},
        {ticketID: 3, orders: 'steak, potatoes', total: 125.00}
    ]);


    const handeClick = () => {
        console.log('greetings');
        setMsg('new msg');
        setIdNum(25);
    }

    return (  
        < div className="home">
        <><React.Fragment>
            <section>
                <div className="w-screen h-250 grid grid-rows-2 text-gray text-4xl grid-cols-2">
                    <div className='w-full h-100 centered '>
                    
                    
                    {tickets.map((ticket) => (
                        <div className="ticket-preview" key={ticket.ticketID}>
                            <h2>ticketID: {ticket.ticketID}</h2>
                            <h3>Orders: {ticket.orders}</h3>
                            <p>total: {ticket.total}</p>

                        </div>
                    ))}
                    </div> 
                </div>

                    <div className="w-full h-100 bg-black centered md:h-screen">
                        <p>Page 2</p>
                    </div>
                
            </section>
        </React.Fragment></>
        </div>
        /**/
    );
}
 
export default Home;
